// Pro -> price of team
function getTeamPrice(qt) {
  var price = parseInt(PRICE_UNL);
  //change according to seats
  if(qt > 5) {
    price = parseInt(PRICE_UNL) + 4*parseInt(PRICE_UNL)*parseFloat(PRICE_MULT_1) + (qt - 5)*parseInt(PRICE_UNL)*parseFloat(PRICE_MULT_2);
  } else if(qt > 1) {
    price = parseInt(PRICE_UNL) + (qt - 1)*parseInt(PRICE_UNL)*parseFloat(PRICE_MULT_1);
  }
  return Math.round(price*100)/100;
};

function getTeamFullPrice(qt) {
  var price = 199;
  //change according to seats
  if(qt > 5) {
    price = 199 + 4*199*parseFloat(PRICE_MULT_1) + (qt - 5)*199*parseFloat(PRICE_MULT_2);
  } else if(qt > 1) {
    price = 199 + (qt - 1)*199*parseFloat(PRICE_MULT_1);
  }
  return Math.round(price*100)/100;
};

function getTeamMembershipPrice(qt) {
  var price = 89;
  //change according to seats - implement correct evaluation
  if(qt > 10) {
    price = price + (9*71.2) + (qt - 10)*66.75;
  } else {
    price = price + (qt - 1)*71.2;
  }
  return Math.round(price*100)/100;
};

